import React from 'react'
import "./featured.css"

const Featured = () => {
  return (
    <div className='featured'> 
      <div className='featuredItem'>
        <img src='https://www.pexels.com/photo/green-manicure-art-close-up-photo-704815/'  alt='featured'/>
      </div>
    </div>
  )
}

export default Featured
